query BlogPostByPath(
  $path: String!
) {
  markdownRemark(frontmatter: {path: {eq: $path}}) {
    html
    frontmatter {
      path
      title
      subtitle
      date
    }
  }
}

query BlogIndexQuery {
  allMarkdownRemark(sort: {fields: [frontmatter___date], order: ASC}) {
    edges {
      node {
        id
        frontmatter {
          path
          date
          title
          subtitle
        }
        excerpt
      }
    }
  }
}

